import React, { Fragment } from 'react';

const Header = () => {

    return(
    <Fragment>
        <div class="d-flex flex-row justify-content-center">
            <div class="p-2">Applications</div>
            <div class="p-2">Vendors</div>
            <div class="p-2">More</div>
        </div>
    </Fragment>);
};

export default Header;
